import React from "react";
import RenderCity from "./RenderCity";
const City=(props)=>{
    return(
        <div>
            {
                props.items.map(city=>(
                    <RenderCity
                    key={Math.random}
                    name={props.name}
                    subText={props.subText}
                    image={props.image}
                    ></RenderCity>
                ))
            }
        </div>
        
    )
};
export default City;
